   fillInMissingEffectPrices() {
        for (let [ hat_name, effect_json ] of Object.entries(this.pricing)) {
            let effects_defined = Object.keys(effect_json)
            for (let [ missing_effect, filler_json ] of Object.entries(this.rules['missing_effects'])) {
                if (!effects_defined.includes(missing_effect)) {
                    for (let [ filler_effect, filler_multiplier ] of Object.entries(filler_json)) {
                        if (effects_defined.includes(filler_effect) && this.pricing[hat_name][filler_effect] != 0) {
                            //console.log(`Applying Price fix to ${hat_name}:${missing_effect}. Using ${filler_effect} with multiplier ${filler_multiplier}`)
                            this.pricing[hat_name][missing_effect] = this.pricing[hat_name][filler_effect] * filler_multiplier
                            break;
                        }
                    }
                    
                }
            }
        }
    }

    modifyPrices() {
        for (let [ generation, multiplier ] of Object.entries(this.rules['rules']['downgrade_effects_multiplier'])) {
            for (let [ hat_name, effect_json ] of Object.entries(this.pricing)) {
                for (let effect of this.rules[generation]) {
                    if (effect in effect_json) {
                        this.pricing[hat_name][effect] *= multiplier
                    }
                }
            }
        }
    }

